import 'dart:math';
import 'package:flutter/material.dart';
import '../model/animal.dart';

class JogoMemoria extends StatefulWidget {
  const JogoMemoria({super.key});
  @override
  State<JogoMemoria> createState() => _JogoMemoriaState();
}

class _JogoMemoriaState extends State<JogoMemoria> {
  List<Animal> listaAnimaisJogo = [
    Animal(
        id: 1,
        nome: 'Leão',
        visible: false,
        encontrado: false,
        avatar:
            'data:image/png;base64,'),
    Animal(
        id: 1,
        nome: 'Leão',
        visible: false,
        encontrado: false,
        avatar:
            'data:image/png;base64,'),
    Animal(
        id: 2,
        nome: 'Zebra',
        encontrado: false,
        visible: false,
        avatar:
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQORxxawvIoMOMObwELDrN6ApGokc8gFl2lHrFo7W9qdpzP_Vvonf-Y6fEo0loZGjC4fPE&usqp=CAU'),
    Animal(
        id: 2,
        nome: 'Zebra',
        encontrado: false,
        visible: false,
        avatar:
            'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQORxxawvIoMOMObwELDrN6ApGokc8gFl2lHrFo7W9qdpzP_Vvonf-Y6fEo0loZGjC4fPE&usqp=CAU'),
    Animal(
        id: 3,
        nome: 'Cavalo',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 3,
        nome: 'Cavalo',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 4,
        nome: 'Elefante',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 4,
        nome: 'Elefante',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 5,
        nome: 'cachorro',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 5,
        nome: 'cachorro',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/jpeg;base64,'),
    Animal(
        id: 6,
        nome: 'vaca',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/png;base64,'),
    Animal(
        id: 6,
        nome: 'vaca',
        encontrado: false,
        visible: false,
        avatar:
            'data:image/png;base64,')
  ];
  List<Animal> listaAnimaisComparados = [];
  int tentativas = 0;

  @override
  void initState() {
    super.initState();
    iniciarJogo();
  }

  iniciarJogo() {
    tentativas = 0;
    //embaralha os objetos dentro da lista
    listaAnimaisJogo.shuffle(Random());

    //adiciona true para o atributo visible de todas os animais, deixando todas as imagens visíveis
    for (var animal in listaAnimaisJogo) {
      animal.visible = true;
    }

    //limpa a lista de animais comparados
    listaAnimaisComparados.clear();

    //adiciona false ao atributo encontrado de todos os animais
    for (var animal in listaAnimaisJogo) {
      animal.encontrado = false;
    }

    //aguarda 5 minutos e esconde todas as imagens
    Future.delayed(const Duration(seconds: 5), () {
      setState(() {
        for (var animal in listaAnimaisJogo) {
          animal.visible = false;
        }
      });
    });
    //chama o método set state e altera todo o estado da tela
    setState(() {});
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text('Jogo da Memória'),
      ),
      body: Column(
        children: [
          Padding(
            padding: const EdgeInsets.all(8.0),
            child: ElevatedButton(
                onPressed: () {
                  iniciarJogo();
                },
                child: const Text('Recomeçar', style: TextStyle(fontSize: 22))),
          ),
          Center(
            child: Text(
              'Tentativas $tentativas',
              style: const TextStyle(fontSize: 22),
            ),
          ),
          Expanded(
            child: GridView.builder(
              gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(
                crossAxisCount: 6,
              ),
              itemCount: listaAnimaisJogo.length,
              itemBuilder: (BuildContext ctx, index) {
                return Padding(
                  padding: const EdgeInsets.all(10),
                  child: ElevatedButton(
                    onPressed: () {
                      if (listaAnimaisComparados
                          .contains(listaAnimaisJogo[index])) {
                        return;
                      }

                      if (listaAnimaisJogo[index].encontrado) {
                        return;
                      }

                      setState(() {
                        listaAnimaisJogo[index].visible = true;
                      });

                      listaAnimaisComparados.add(listaAnimaisJogo[index]);

                      if (listaAnimaisComparados.length == 2) {
                        if (listaAnimaisComparados[0].id ==
                            listaAnimaisComparados[1].id) {
                          listaAnimaisComparados[0].encontrado = true;
                          listaAnimaisComparados[1].encontrado = true;
                        }

                        setState(() {
                          tentativas = ++tentativas;
                        });
                      } else if (listaAnimaisComparados.length > 2) {
                        listaAnimaisComparados.clear();
                        for (var animal in listaAnimaisJogo) {
                          if (!animal.encontrado) {
                            animal.visible = false;
                          }
                        }

                        setState(() {
                          listaAnimaisJogo[index].visible = true;
                        });

                        listaAnimaisComparados.add(listaAnimaisJogo[index]);
                      }
                    },
                    child: SizedBox(
                      height: 100,
                      width: 100,
                      child: listaAnimaisJogo[index].visible
                          ? Image.network(listaAnimaisJogo[index].avatar)
                          : Container(
                              color: Colors.blue,
                            ),
                    ),
                  ),
                );
              },
            ),
          ),
        ],
      ),
    );
  }
}
